import { publicAxios as axios } from '../../axios';
export const getBranches = async (auth) => {
	try {
		const { data } = await axios.get('/branches', {
			headers: {
				Authorization: auth.authToken,
			},
		})
		return data
	} catch (error) {
		return error
	}
}

export const getWorkshops = async (auth, distributorId) => {
	const { data } = await axios.get(`/distributors/${distributorId}/workshops`, {
		headers: {
			Authorization: auth.authToken,
		}
	})
	return { data: data }
}
export const getEmployee = async (auth, employeeId) => {
	const { data } = await axios.get(`/employee/${employeeId}`, {
		headers: {
			Authorization: auth.authToken,
		}
	})
	return { data: data }
}
